import React from "react";

class SearchBar extends React.Component {
  state = { searchInput: "" };
  fun = (event) => {
    console.log(event.target.value);
  };
  render() {
    return (
      <div>
        <form className="d-flex">
          <input
            className="form-control me-2"
            type="search"
            placeholder="Search"
            aria-label="Search"
            onChange={this.fun}
          />
        </form>
      </div>
    );
  }
}

export default SearchBar;
